// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Auth from './Auth';
import Main from './Main';

const App = () => {
  const isAuthenticated = true; 

  return (
    <Router>
      <Routes>
      <Route
        exact
        path="/auth"
        render={() => (isAuthenticated ? <Navigate to="/main" /> : <Auth />)}
      />
      <Route
        exact
        path="/main"
        render={() => (isAuthenticated ? <Main /> : <Navigate to="/auth" />)}
      />
      </Routes>
    </Router>
  );
};

export default App;
